import { Nav, Tab } from "react-bootstrap";
import React from "react";
import Button from "react-bootstrap/Button";
import { IoMdAddCircleOutline } from "react-icons/io";
// import styles from "../../styles/UsermanageCustomer.module.scss";

// import styles from "./Analytics.module.scss";
// import Line from "./Charts/Line";
// import StackedColumns from "./Charts/StackedColumns";
// import GroupedBars from "./Charts/GroupedBars";
// import { Link } from "react-router-dom";
// import { WiStars } from "react-icons/wi";
// import { FaArrowRight } from "react-icons/fa";

const UsermanageCustomer = () => {
  return (
    <>
      <div
        className="mainbody_container bg-white m-3 p-3"
        style={{ Padding: "3rem", Width: "100%" }}>
        <div className="container pagetitle my-2">
          <h1>User Management</h1>
        </div>

        {/* Tabs */}

        <div className="profile_tab_div my-3 py-3">
          <Tab.Container id="center-tabs-example" defaultActiveKey="customer">
            <div className="profile_tab_div2">
              <div className="row">
                <div className="col-12">
                  <Nav variant="pills" className="tabpillsscroll">
                    <Nav.Item>
                      <Nav.Link eventKey="customer">Customers</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                      <Nav.Link eventKey="employees">Employees</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                      <Nav.Link eventKey="subcontractor">
                        Sub-Contactor
                      </Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                      <Nav.Link eventKey="reception">Receptions</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                      <Nav.Link eventKey="refereers">Refereers</Nav.Link>
                    </Nav.Item>
                  </Nav>
                </div>
              </div>
            </div>

            <Tab.Content>
              <Tab.Pane eventKey="OffBoard">
                <div className="m_t"></div>
                {/* <OffBoard /> */}
              </Tab.Pane>
              <Tab.Pane eventKey="MyRole">
                <div className="m_t"></div>
                <h1>My Role</h1>
              </Tab.Pane>
              <Tab.Pane eventKey="first">
                <div className="m_t"></div>
                {/* <AnnouncementFilter />
                <Announcement /> */}
              </Tab.Pane>
              <Tab.Pane eventKey="second">
                <div className="m_t"></div>
                <div>{/* <AboutProfile /> */}</div>
              </Tab.Pane>
              <Tab.Pane eventKey="second1">
                <div className="m_t"></div>
                {/* <Experience /> */}
                <div className="m_t"></div>
                {/* <PreviousExperiences /> */}
              </Tab.Pane>
              <Tab.Pane eventKey="second2">
                <div className="m_t"></div>
                {/* <EmployeesDocument /> */}
              </Tab.Pane>
              <Tab.Pane eventKey="Assets">
                <div className="m_t"></div>
                {/* <IssueAssets /> */}
                <div className="m_t"></div>
                {/* <ReturnIssueAssets /> */}
              </Tab.Pane>
              <Tab.Pane eventKey="Board">
                <div className="m_t"></div>

                <div className="profile_iner_cont">
                  <div className="EmployeesDocument_top_title">
                    <h3> Salary Stracture</h3>
                  </div>
                  {/* <SalaryStracture /> */}
                </div>
              </Tab.Pane>
              <Tab.Pane eventKey="Projects">
                <div className="m_t"></div>
                {/* <Projects /> */}
              </Tab.Pane>
            </Tab.Content>
          </Tab.Container>
        </div>

        <div className="row">
          <div className="col-md-6">
            <div>
              <Button variant="outline-primary" className="btnoutline">
                <IoMdAddCircleOutline /> Add new customer
              </Button>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default UsermanageCustomer;
